import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [adoptapetData, setAdoptapetData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('/api/adoptapet'); // Assumes the React app and backend are on the same host
        setAdoptapetData(response.data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Adoptapet Data</h1>
      <pre>{JSON.stringify(adoptapetData, null, 2)}</pre>
    </div>
  );
}

export default App;
